INSERT INTO `main_notice` VALUES (73, 'Springboot+SpringSecurity实现图片验证码登录问题', '<p>这个问题,网上找了好多,结果代码都不全,找了好多,要不是就自动注入的类注入不了,编译报错,要不异常捕获不了浪费好多时间,<strong>就觉得,框架不熟就不能随便用,全是坑</strong>,气死我了,最后改了两天.终于弄好啦;</p><p><strong>问题主要是:</strong></p><p><br></p><ol><li><strong style=\"color: rgb(255, 0, 0);\">返回的验证码不知道在SpringSecurity的哪里和存在Session里的比较.</strong></li><li><strong style=\"color: rgb(255, 0, 0);\">比较之后应该怎么处理,</strong></li><li><strong style=\"color: rgb(255, 0, 0);\">其次是捕获验证码错误异常的处理,</strong></li></ol><p><strong>这个问题比较多,网上大都是直接注入一个AuthenticationFailureHandler,我就不明白这个咋注进去的,我这个一写就报错,注入不进去,后来就想自己new一个哇,就OK了</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">new AuthenticationFailureHandler() {\n                    @Override\n                    public void onAuthenticationFailure(HttpServletRequest httpServletRequest, HttpServletResponse httpServletResponse, AuthenticationException e) throws IOException, ServletException {\n                        httpServletResponse.setContentType(\"application/json;charset=utf-8\");\n                        PrintWriter out = httpServletResponse.getWriter();\n                        RespBean respBean = RespBean.error(\"验证码错误!\");\n                        out.write(new ObjectMapper().writeValueAsString(respBean));\n                        out.flush();\n                        out.close();\n                    }\n                }.onAuthenticationFailure(request, response, e);\n                return;\n</pre><p><br></p><p>​<img src=\"https://img-blog.csdnimg.cn/20200208151115426.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3Nhbmhld3V5YW5n,size_16,color_FFFFFF,t_70\" height=\"697\" width=\"795\"><img src=\"data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==\" height=\"15\" width=\"15\">​​​<img src=\"https://img-blog.csdnimg.cn/20200208155432536.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3Nhbmhld3V5YW5n,size_16,color_FFFFFF,t_70\" height=\"691\" width=\"793\"><img src=\"data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==\" height=\"15\" width=\"15\">​​</p><h2>流程&nbsp;</h2><h3>&nbsp;请求登录页,将验证码结果存到基于Servlet的session里,以JSON格式返回验证码,</h3><h3>之后前端发送登录请求,SpringSecurity中处理,自定义一个filter让它继承自OncePerRequestFilter，然后重写doFilterInternal方法,在这个方法中实现验证码的功能，如果验证码错误就抛出一个继承自AuthenticationException的验证吗错误的异常消息写入到响应消息中.</h3><h3>之后返回异常信息</h3><h2>下面以这个顺序书写代码:</h2><p>依赖大家照着import导一下吧,记得有这两个,验证码需要一个依赖,之后还使用了一个工具包</p><p><br></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">​\n\n &lt;!--图片验证--&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;com.github.whvcse&lt;/groupId&gt;\n            &lt;artifactId&gt;easy-captcha&lt;/artifactId&gt;\n            &lt;version&gt;1.6.2&lt;/version&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.apache.commons&lt;/groupId&gt;\n            &lt;artifactId&gt;commons-lang3&lt;/artifactId&gt;\n        &lt;/dependency&gt;\n</pre><p><br></p><p>前端使用Vue+ElementUI</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">     \n        &lt;div class=\"login-code\"&gt;\n          &lt;img :src=\"codeUrl\"\n               @click=\"getCode\"&gt;\n        &lt;/div&gt;\n \n     \n</pre><p><br></p><p><strong>后端代码:</strong></p><h3>获取验证码,将结果放到session里</h3><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">package com.liruilong.hros.controller;\n\nimport com.liruilong.hros.model.RespBean;\nimport org.springframework.web.bind.annotation.GetMapping;\nimport org.springframework.web.bind.annotation.RestController;\nimport com.wf.captcha.ArithmeticCaptcha;\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\nimport java.util.HashMap;\nimport java.util.Map;\n\n/**\n * @Description :\n * @Author: Liruilong\n * @Date: 2019/12/19 19:58\n */\n@RestController\npublic class LoginController {\n    \n    @GetMapping(value = \"/auth/code\")\n    public Map getCode(HttpServletRequest request,HttpServletResponse response){\n        // 算术类型 https://gitee.com/whvse/EasyCaptcha\n        ArithmeticCaptcha captcha = new ArithmeticCaptcha(111, 36);\n        // 几位数运算，默认是两位\n        captcha.setLen(2);\n        // 获取运算的结果\n        String result = captcha.text();\n        System.err.println(\"生成的验证码：\"+result);\n        // 保存\n        // 验证码信息\n        Map&lt;String,Object&gt; imgResult = new HashMap&lt;String,Object&gt;(2){{\n            put(\"img\", captcha.toBase64());\n    \n        }};\n        request.getSession().setAttribute(\"yanzhengma\",result);\n\n        return imgResult;\n    }\n}\n</pre><p><strong>security配置.&nbsp;</strong></p><p><strong>在之前的基础上加filter的基础上加了</strong></p><p><strong>http.addFilterBefore(verifyCodeFilter, UsernamePasswordAuthenticationFilter.class)</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\"> /**\n     * @Author Liruilong\n     * @Description  放行的请求路径\n     * @Date 19:25 2020/2/7\n     * @Param [web]\n     * @return void\n     **/\n    @Override\n    public void configure(WebSecurity web) throws Exception {\n        web.ignoring().antMatchers(\"/login\",\"/css/**\",\"/js/**\", \"/index.html\", \"/img/**\", \"/fonts/**\",\"/favicon.ico\",\"/auth/code\");\n    }\n\n\n    @Override\n    protected void configure(HttpSecurity http) throws Exception {\n        http.addFilterBefore(verifyCodeFilter, UsernamePasswordAuthenticationFilter.class)\n                .authorizeRequests()\n                //.anyRequest().authenticated()\n             ...........\n\n    }\n</pre><p><br></p><p><strong>定义一个VerifyCodeFilter&nbsp;过滤器</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">package com.liruilong.hros.filter;\n\n\nimport com.fasterxml.jackson.databind.ObjectMapper;\nimport com.liruilong.hros.Exception.ValidateCodeException;\nimport com.liruilong.hros.model.RespBean;\nimport org.apache.commons.lang3.StringUtils;\nimport org.springframework.context.annotation.Bean;\nimport org.springframework.security.core.AuthenticationException;\nimport org.springframework.security.web.authentication.AuthenticationFailureHandler;\nimport org.springframework.stereotype.Component;\nimport org.springframework.web.filter.OncePerRequestFilter;\nimport javax.servlet.FilterChain;\nimport javax.servlet.ServletException;\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\nimport java.io.IOException;\nimport java.io.PrintWriter;\n\n\n/**\n * @Description :\n * @Author: Liruilong\n * @Date: 2020/2/7 19:39\n */\n@Component\npublic class VerifyCodeFilter extends OncePerRequestFilter {\n    \n    @Bean\n    public VerifyCodeFilter getVerifyCodeFilter() {\n        return new VerifyCodeFilter();\n    }\n    @Override\n    protected void doFilterInternal(HttpServletRequest request, HttpServletResponse response, FilterChain filterChain) throws ServletException, IOException, ValidateCodeException {\n\n        if (StringUtils.equals(\"/doLogin\", request.getRequestURI())\n                &amp;&amp; StringUtils.equalsIgnoreCase(request.getMethod(), \"post\")) {\n            // 1. 进行验证码的校验\n            String requestCaptcha = request.getParameter(\"code\");\n            String code = (String) request.getSession().getAttribute(\"yanzhengma\");\n            logger.info(\"开始校验验证码，生成的验证码为：\" + code + \" ，输入的验证码为：\" + requestCaptcha);\n            try {\n                if (StringUtils.isBlank(requestCaptcha)) {\n                    throw new ValidateCodeException(\"验证码不能为空！\");\n                }\n                if (requestCaptcha == null) {\n                    throw new ValidateCodeException(\"验证码不存在\");\n                }\n                if (!StringUtils.equals(code, requestCaptcha)) {\n                    throw new ValidateCodeException(\"验证码不匹配\");\n                }\n            } catch (AuthenticationException e) {\n                // 2. 捕获步骤1中校验出现异常，交给失败处理类进行进行处理\n                new AuthenticationFailureHandler() {\n                    @Override\n                    public void onAuthenticationFailure(HttpServletRequest httpServletRequest, HttpServletResponse httpServletResponse, AuthenticationException e) throws IOException, ServletException {\n                        httpServletResponse.setContentType(\"application/json;charset=utf-8\");\n                        PrintWriter out = httpServletResponse.getWriter();\n                        RespBean respBean = RespBean.error(\"验证码错误!\");\n                        out.write(new ObjectMapper().writeValueAsString(respBean));\n                        out.flush();\n                        out.close();\n                    }\n                }.onAuthenticationFailure(request, response, e);\n                return;\n            }\n            filterChain.doFilter(request, response);\n        }\n        filterChain.doFilter(request, response);\n    }\n\n\n}\n</pre><p><br></p><p>之后就可以啦</p><p><br></p><h3><strong>感觉主要是捕获验证码错误异常的处理,</strong></h3><p><strong>这个问题比较多,网上大都是直接注入一个AuthenticationFailureHandler,我就不明白这个咋注进去的,我这个一写就报错,注入不进去,后来就想自己new一个哇,</strong></p><p><br></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">new AuthenticationFailureHandler() {\n                    @Override\n                    public void onAuthenticationFailure(HttpServletRequest httpServletRequest, HttpServletResponse httpServletResponse, AuthenticationException e) throws IOException, ServletException {\n                        httpServletResponse.setContentType(\"application/json;charset=utf-8\");\n                        PrintWriter out = httpServletResponse.getWriter();\n                        RespBean respBean = RespBean.error(\"验证码错误!\");\n                        out.write(new ObjectMapper().writeValueAsString(respBean));\n                        out.flush();\n                        out.close();\n                    }\n                }.onAuthenticationFailure(request, response, e);\n                return;\n</pre><p><span style=\"color: rgb(7, 93, 179);\"><img src=\"https://common.cnblogs.com/images/copycode.gif\" alt=\"复制代码\"></span></p>', '系统管理员', '2020-02-09 00:19:20', '2021-05-08 00:35:48');
INSERT INTO `main_notice` VALUES (74, '基于Spring Boot框架的 人事管理系统的设计与实现', '<h1 class=\"ql-align-center\"><strong>基于Spring Boot框架的</strong></h1><h1 class=\"ql-align-center\"><strong>人事管理系统的设计与实现</strong></h1><p class=\"ql-align-center\"><br></p><h2 class=\"ql-align-center\"><strong>数学学院2020届信息与计算科学专业1班李瑞龙</strong></h2><p class=\"ql-align-center\"><br></p><h1 class=\"ql-align-justify\">1引言</h1><p class=\"ql-align-justify\">1.1研发背景</p><p>	目前,人事管理的系统大都是CS架构的大型系统,很少有面向机关,事业单位内部的基于BS架构的微型人事系统,因此.开发一个基于BS架构的人事信息管理系统是非常必要的.但是基于BS架构的人事系统对于安全是一个大的考验点.在人事信息系统中,功能需简单清晰,可操作性强,其次安全和权限是关键点.对人事信息的保密涉及到安全处理,对不同的操作员角色根据保密级别给予不同权限,是当前信息系统的基本需求.</p><p class=\"ql-align-justify\">1.2研发的目的及意义</p><p>	基于Spring Boot的人事管理系统符合当下的生产实际需求,对于一般的机关和事业单位来讲,对人事系统在功能方面没有复杂的需求,满足基本需求即可,同时,要求软件的经济成本较低,界面相对好看,实施部署容易,即不需要通过SaaS平台供应商耗费大量金钱,由内部人员实施维护.所以本设计的实现是很有意义的.</p><p class=\"ql-align-justify\">1.3国内外研发现状</p><p>	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;人事管理的系统软件的研发在多年来不断发展.不断革新.在公共管理学科领域中对\"E-HR成功实施\"的不断探索为E-HR的研发提供了理论和前提.国外的发展相较于国内早30多年.成熟的产品有SPA,Oracle等.国内而言.术业有专攻.不同的业务场景有不用的强势产品.制造行业的有汇通科技.国有企业的有宏景软件.互联网行业的有欢雀HR.综合性较强的有用友,金蝶等等.</p><p><br></p><h1 class=\"ql-align-justify\">2项目概述</h1><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;人事管理系统功能包括人事通讯,员工信息,人事考评,奖惩,培训管理,薪资管理,统计分析,和系统管理六大模块,对应人事工作基本流程:新员工入职档案建立,调动,辞职,员工信息的查询及工资管理等方面.系统管理可以根据不同的角色分配菜单权限设置,不同的用户授予不同角色,对人事结构,单位结构进行整体调配设置.在线聊天可以实现操作员之间讯息的及时通讯.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;项目基于MVVM的前后端分离开发模式进行开发.MVVM即模型(Model)-视图(View)-视图模型(View Model),实现了数据视图的双向绑定.相对于MVC模式和MVP来说,MVVM是一个比较新的开发架构,它是一种将MVP模式与WPF相结合应用方式发展演变而成的新型开发架.<sup>[1]</sup></p><p>	前后端分离是指将前端和后端从之前的全部由后端负责中分离开来,不再共用一个Server,前端作为一个独立Serve存在.<sup>[2]</sup>前后端通过接口使用HTTP协议交互,本项目使用vu实体属性outer做前端路由处理.页面跳转不在由后端处理,前后端只是数据的交互.前后端分离的好处在于降低了前后端的耦合性.当面对不同的硬件场景时,需要构建不同的界面,前后端分离之后,只需要扩展前端项目即可,不需要修改后端服务.</p><p>	在动态权限处理方面,使用安全框架Spring Security,基于RBAC（Role-Based Access Control ）角色的访问控制模型,由该模型主要由鉴权和授权构成,鉴权基于Servlet中Filter原理处理,授权由系统管理员操作.RBAC 的主要思想是：权限是和角色相关的,而用户则被分配相应的角色作为其成员,这样就大大简化了权限的管理.<sup>[3]</sup></p><h1 class=\"ql-align-justify\"><span style=\"color: black;\">3</span>系统分析</h1><p class=\"ql-align-justify\">3.1系统可行性分析</p><p class=\"ql-align-justify\">3.1.1运营可行</p><p>&nbsp;&nbsp;本系统在打包之后整体大小只有38MB,硬件内存需求相当于一个移动端的普通App大小,运行内存基本上普通的单核CPU,2G RAM的ESC就可以满足需求,系统硬件需求低.访问兼容大部分浏览器（IE8/9/10/11,Chrome,Firefox）,用户体验处理上,由前端视图操作通知,结合后端逻辑处理消息构成.响应用户的每一步操作.构建了良好的用户体验.</p><p class=\"ql-align-justify\">3.1.2技术可行性</p><p>	本系统中技术使用,后端技术涉及到Spring Boot,Spring Security, MyBatis, MySQL等,前端技术设计到Vue, ElementUI, axios,Web Socket等.系统架构基于B/S架构.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Spring Boot是当前流行的Java EE体系框架,Spring Boot提供了一种新的编程范式,能在小的阻力下开发Spring应用程序,可以更加敏捷地开发Spring应用程序,专注于应用程序的功能,不用在Spring的配置上多花功夫,甚至完全不用配置<sup>[4]</sup>.Spring Boot遵循约定大于配置的理念,在父子工程理念上极大程度上解决了依赖冲突的问题.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Spring Security是Spring家族中的安全框架,Spring Boot对于Spring Security提供了自动化配置方案,可以零配置使用 Spring Security .Spring Security借助过滤器技术对Web应用进行保护,包括认证和授权两个过程<sup>[5]</sup>.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mybatis,MySQL是持久化技术,都是开源轻量,Mybatis是ORM解决方案,MySQL是数据库系统.</p><p>&nbsp;&nbsp;Vue 是一套用于构建用户界面的渐进式框架.与其它大型框架不同的是,Vue 被设计为可以自底向上逐层应用,Vue 的核心库只关注视图层,不仅易于上手,还便于与第三方库或既有项目整合.<sup>[6]</sup></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;axios是基于Promise 用于浏览器和 node.js 的 HTTP 客户端的异步编程解决方案,可以从浏览器中创建XMLHttpRequests,从node.js中创建http请求,支持Promise API,拦截请求和响应,转换请求数据和响应数据,客户端支持防御XSRF等.<sup>[7]</sup></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;vu实体属性outer在项目中用于前端动态加载路由管理.SPA应用来讲,其实就是在前后端分离的基础上,加一层前端路由,即是由前端来维护路由规则,实现有两种,一种是利用url的hash,另一种就是HTML5的History模式.<sup>[8]</sup>这里我们使用vu实体属性outer的hash方式.</p><p>	B/S架构是对C/S架构的一种改进,软件应用的业务逻辑完全由服务端实现<sup>[9]</sup>,依托于浏览器,相对于C/S更轻量,用户体验要差一些,但是基于B/S的SPA和AJAX技术完美的解决了这个问题.</p><p class=\"ql-align-justify\">3.1.3经济可行性</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;实现人事管理的自动化,HR在减少失误的同时精简许多费用开支,在硬件消耗上依托于互联网.同时开发使用技术工具基本为开源产品技术.</p><p class=\"ql-align-justify\">3.2系统流程分析</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本系统所有管理员或操作员经由自定义验证,表单验证通过之后,会进行请求路径分析,Spring Security会进行鉴权处理,确认当前登录用户的角色,匹配放行响应的资源.之后进行的业务,都是经过鉴权处理的,管理员对系统的操作都将被记录在日志里.前端会对所有请求拦截进行统一处理.分析需要返回数据还是消息.</p><p class=\"ql-align-justify\">3.2.1系统访问控制流程图</p><p>	访问控制基于RBAC0模型.由于之相对应的数据实体构成.由用户表,角色映射表,角色表,权限表,权限映射表构成.用户登录之后首先进行身份验证,成功之后获取当前用户的所有角色,之后根据角色加载对应的权限菜单, 前端为了良好的用户体验,这里默认不加载没有权限的菜单.当存在直接输入URL路径的情况时,对于登录用户的每一个请求,都会通过鉴权处理,分析角色.最后通过权限的判断分析是否可以访问菜单资源.</p>', '系统管理员', '2021-05-08 00:34:10', '2021-05-08 00:34:10');
